import React from 'react';
import PropTypes from 'prop-types';

function Add(name, description) {
    return (
        <div className={name}>
            <p>{name}...........................{description}</p>
        </div>
    );
}

Add.propTypes = {
    name: PropTypes.string,
    description: PropTypes.string,
}

Add.defaultProps = {
    name: "some name",
    description: "text that describes the product"
}

export default Add;
